INSERT INTO `tbl_system_settings` (`id`, `tbl_customer_type_from_id`, `tbl_system_settings_cms_page_name_id`, `description`, `meta_title`, `meta_keyword`, `meta_description`, `sorting`, `type`, `status`) VALUES
(1, 1, 1, '<div class=\"about_content\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h1>Welcome to Fruitastic</h1>\r\n</div>\r\n\r\n<div class=\"animatedParent col-md-12 col-sm-12\">\r\n<div class=\"animated fadeInLeft pull-left video\"><a href=\"#\"><!--<iframe src=\"https://www.youtube.com/embed/IDG3_J0TTXU?ecver=2\" width=\"640\" height=\"360\" frameborder=\"0\" style=\"position:absolute;width:100%;height:100%;left:0\" allowfullscreen></iframe>--> <img alt=\"\" class=\"img-responsive\" src=\"http://www.binaryfrog.co/dev/assets/front/images/about4.jpg\"> <span style=\"background-color: rgb(239, 239, 239);\"><img alt=\"\" class=\"icon\" src=\"http://www.binaryfrog.co/dev/assets/front/images/vedio.png\"> </span></a></div>\r\n<!--</div>\r\n          <div class=\"col-md-7 col-sm-7 animatedParent\">-->\r\n\r\n<h3><b style=\"\"><i style=\"\"><u style=\"background-color: rgb(156, 0, 255);\">A man with a dream about farm fresh produce</u></i></b></h3>\r\n\r\n<p>Fruitastic is a classic elucidation of how vision and perseverance of a small team of individuals can impact lives of thousands. We are extraordinarily simple people with one elementary goal; deliver garden-fresh fruits and veggies to every household in Victoria. Our ultra-simple and user friendly website enables and empowers our customers to order locally grown fruit and vegetables from the comfort of their homes. We are simplifying the lives of our fellow Victorians with our remarkably prompt service. Primary reason behind our phenomenal success is our sheer commitment to quality, we have never compromised on the freshness and quality of our products and this is why we only partner with the well-reputed premium Australian farms. In a nutshell Fruitastic is the one stop shop for all Victorians when it comes to fresh hand plucked fruit and vegetables.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"aboutbox row\">\r\n<div class=\"animatedParent col-md-12 col-sm-12\">\r\n<h3>Our mission</h3>\r\n<img alt=\"\" class=\"about-right-image animated fadeInRight hidden-xs img-responsive\" src=\"&#10;http://www.binaryfrog.co/dev/assets/front/images/kids-eating-watermelon.jpg\">\r\n<p>With the use of the latest systems and technologies, along with our 15+ years experience as Melbourne\'s premier fruit and vegetable home delivery service to not only homes, but school and child care centres alike, our mission is to supply the best quality Australian produce to all Victorians, hassle free. Ensuring each and every man, woman and child has access to a time saving service that encourages healthy eating habits and promotes the 2 and 5 concept. ( 2 fruit and 5 veg per person, per day)</p>\r\n\r\n<p>We strive to ensure each and every piece will be enjoyed in its freshest possible state, packed with vitamins and flavour, without the hassle of going to farmers markets or fruit shops and supermarkets.</p>\r\n\r\n<p>It\'s a fact that most Australians don\'t achieve the 2 and 5, however we aim to change this through lower prices, greater service, fast home, school or office delivery and with influencers on our social media videos and blogs which are aimed at educating and promoting healthier eating habits and practices.</p>\r\n\r\n<p>Please feel free to join our social pages for tips and tricks, along with recipes and much much more which will help you buy smarter, save you money and keep the whole family eating and living healthier.</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"about-us-padding animatedParent col-md-12 col-sm-12\"><img alt=\"\" class=\"about-left-image animated fadeInLeft hidden-xs img-responsive\" src=\"http://www.binaryfrog.co/dev/assets/front/images/BREAKIE-FUN.jpg\">\r\n<h3>Our Company</h3>\r\n\r\n<p>VICTORIA\'S NO. 1 PREMIUM FRUIT AND VEGETABLE DELIVERY SERVICE, CATERING TO HOMES, SCHOOLS AND CHILDCARE CENTRES AND CORPORATE CLIENTS.</p>\r\n\r\n<p>Our service started way back in 1993. Its taken on many changes and a few faces and we are proud to be one of the Pioneers in Fruit and veg Home deliveries in Melbourne. In 2005 Fruitastic was formed and remains an Australian family owned and run business, setting the benchmark for fresh fruit and vegetable deliveries and changing the way consumers buy fresh produce.</p>\r\n\r\n<p>We are leading the way in the fresh fruit and vegetable delivery industry. Fruitastic have for many years now, been purchasing Premium Australian Grown produce daily from the Melbourne Wholesale Markets and delivering with free delivery, to hundreds of schools, homes and child care centres direct.</p>\r\n\r\n<p>We do not have a retail outlet, which enables us to provide a service many of our competitors, (even the big ones) could only dream about. We provide a service whereby we purchase, pack, and deliver on the same day, to hundreds of happy customers on a daily basis. Our setup and systems in our warehouse enable us to check each individual piece of fruit and vegetable being delivered for bruising, markings, etc. With no retail outlet, we hold no old stock, ensuring you the consumer only has the best, freshest produce delivered. We only buy what we need for each day.</p>\r\n\r\n<p>Our staff are trained, passionate fruit and veg experts, with a keen eye for detail.</p>\r\n\r\n<p>Our deliveries are packed in recyclable boxes which we ask you leave out for collection on the day of your next delivery,ensuring we do our bit for the environment. Oh!! Did we mention this also saves you the consumer on packaging costs and additional charge?</p>\r\n\r\n<p>The benefits of using Fruitastic for your fruit and veg needs in Melbourne far outweigh the few minutes it takes to set up an account, or running to the markets yourself.</p>\r\n\r\n<p>Our service is simple. Premium fruit and vegetables delivered, direct from the growers to your door, with the added bonus of free delivery* subject to post code check and minimum spend.</p>\r\n\r\n<p>With over 80,000 pieces of fruit and vegetables delivered each week, our number 1 goal is ensuring all our clients receive the best Australian Grown produce available in the Melbourne markets on any given day.</p>\r\n</div>\r\n\r\n<div class=\"about-us-padding animatedParent col-md-12 col-sm-12\">\r\n<h3>What We do</h3>\r\n<img alt=\"\" class=\"about-right-image animated fadeInRight go hidden-xs img-responsive\" src=\"http://www.binaryfrog.co/dev/assets/front/images/FRUIT-SMOOTHY.jpg\">\r\n<p>It\'s quite simple really.</p>\r\n\r\n<p>We do our job the best we can, to ensure you have more spare time to do the things you love.</p>\r\n\r\n<p>Our business is built on trust and strong relationships. Relationships with our farmers and growers, and our customers.</p>\r\n\r\n<p>We have created a bridge and platform of expertise to inform, educate and supply our customers with in season, locally grown Australian produce and fruity facts, tips and tricks to have the whole family enjoying Fruitastic produce all year round.</p>\r\n\r\n<p>The power and control is then placed in your hands to order with confidence knowing you will receive great quality value and freshness the very next day from a company passionate about fruit and veg.</p>\r\n\r\n<p>Our team are highly trained in identifying great quality eating produce. We will only pack into your delivery what we too would want to take home to our families.</p>\r\n\r\n<p>Another added bonus of using our service is we give you free educational conte nt throughout our social pages to know what\'s in season, and how to cook, store and prepare incredible meals and lunch box snacks the whole family will love.</p>\r\n\r\n<p>Please like our social pages and subscribe to see what\'s up next.</p>\r\n</div>\r\n</div>\r\n<!--<div class=\"row aboutbox\">\r\n          <div class=\"col-md-4 col-sm-4\">\r\n            <div class=\"box\">\r\n              <img src=\"http://www.binaryfrog.co/dev/assets/front/images/about1.jpg\" alt=\"\" class=\"img-responsive\">\r\n              <div class=\"info\">\r\n                <h4>Our mission</h4>\r\n                <p>With the use of the latest systems and technologies, along with our 15+ years experience as Melbourne\'s premier fruit and vegetable home delivery service to not only homes, but school and child care centres alike, our mission is to supply the best quality Australian produce to all Victorians, hassle free. Ensuring each and every man, woman and child has .... <a href=\"our-mission.html\" class=\"our_mission_link\">read more</a></p> \r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4 col-sm-4\">\r\n            <div class=\"box\">\r\n              <img src=\"http://www.binaryfrog.co/dev/assets/front/images/about2.jpg\" alt=\"\" class=\"img-responsive\">\r\n              <div class=\"info\">\r\n                <h4>Our Company</h4>\r\n                <p>VICTORIA\'S NO. 1 PREMIUM FRUIT AND VEGETABLE DELIVERY SERVICE, CATERING TO HOMES, SCHOOLS AND CHILDCARE CENTRES AND CORPORATE CLIENTS</p>\r\n \r\n				<p>Our service started way back in 1993. Its taken on many changes and a few faces and we are proud to be one of the Pioneers in Fruit and veg Home deliveries in Melbourne .... <a href=\"our-company.html\" class=\"our_mission_link\">read more</a></p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4 col-sm-4\">\r\n            <div class=\"box\">\r\n              <img src=\"http://www.binaryfrog.co/dev/assets/front/images/about3.jpg\" alt=\"\" class=\"img-responsive\">\r\n              <div class=\"info\">\r\n                <h4>What We do</h4>\r\n                <p>It\'s quite simple really. </p>\r\n\r\n				<p>We do our job the best we can, to ensure you have more spare time to do the things you love. </p>\r\n\r\n				<p>Our business is built on trust and strong relationships. Relationships with our farmers and growers, and our customers... <a href=\"our-mission.html\" class=\"our_mission_link\">read more</a></p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n      </div>--></div>\r\n</div>\r\n\r\n<div class=\"about choose_sec\"><!--- choose_sec start -->\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 col-sm-12 text-center\">\r\n<h1>Why Choose Us</h1>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row second_rws\">\r\n<div class=\"col-md-4 col-sm-6 col-xs-12 text-left\">\r\n<div class=\"wrape_all_sect\"><img src=\"&#10;http://www.binaryfrog.co/dev/assets/front/images/organic.png\">\r\n<div class=\"description\" style=\"display: block;\">\r\n<h3>Australian Family Owned</h3>\r\n\r\n<p>Supporting local business that knows you is what we are all about. We understand you better than the big corporate Supermarkets. We ensure you\'re not only receiving great quality produce, but a true old fashioned tailored service and system built around integrity and trust</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"wrape_all_sect\"><img src=\"&#10;http://www.binaryfrog.co/dev/assets/front/images/natural.png\">\r\n<div class=\"description\" style=\"display: none;\">\r\n<h3>100% Natural</h3>\r\n\r\n<p>All our products are 100% natural. Just the way nature intended. We should all be striving to eat less processed and packaged goods, and aim for 2 &amp; 5 (2 fruit and 5 veg serves per day )</p>\r\n</div><div class=\"note-editor note-frame panel panel-default\"><div class=\"note-dropzone\">  <div class=\"note-dropzone-message\"></div></div><div class=\"note-toolbar panel-heading\"><div class=\"note-btn-group btn-group note-style\"><div class=\"note-btn-group btn-group\"><button type=\"button\" class=\"note-btn btn btn-default btn-sm dropdown-toggle\" tabindex=\"-1\" data-toggle=\"dropdown\" title=\"\" data-original-title=\"Style\"><i class=\"note-icon-magic\"></i> <span class=\"note-icon-caret\"></span></button><div class=\"dropdown-menu dropdown-style\"><li><a href=\"#\" data-value=\"p\"><p>p</p></a></li><li><a href=\"#\" data-value=\"blockquote