 10em;\"></div>  <div class=\"note-dimension-picker-highlighted\"></div>  <div class=\"note-dimension-picker-unhighlighted\"></div></div><div class=\"note-dimension-display\">1 x 1</div></div></div></div><div class=\"note-btn-group btn-group note-insert\"><button type=\"button\" class=\"note-btn btn btn-default btn-sm\" tabindex=\"-1\" title=\"\" data-original-title=\"Link (CTRL+K)\"><i class=\"note-icon-link\"></i></button><button type=\"button\" class=\"note-btn btn btn-default btn-sm\" tabindex=\"-1\" title=\"\" data-original-title=\"Picture\"><i class=\"note-icon-picture\"></i></button><button type=\"button\" class=\"note-btn btn btn-default btn-sm\" tabindex=\"-1\" title=\"\" data-original-title=\"Video\"><i class=\"note-icon-video\"></i></button></div><div class=\"note-btn-group btn-group note-view\"><button type=\"button\" class=\"note-btn btn btn-default btn-sm btn-fullscreen\" tabindex=\"-1\" title=\"\" data-original-title=\"Full Screen\"><i class=\"note-icon-arrows-alt\"></i></button><button type=\"button\" class=\"note-btn btn btn-default btn-sm btn-codeview\" tabindex=\"-1\" title=\"\" data-original-title=\"Code View\"><i class=\"note-icon-code\"></i></button><button type=\"button\" class=\"note-btn btn btn-default btn-sm\" tabindex=\"-1\" title=\"\" data-original-title=\"Help\"><i class=\"note-icon-question\"></i></button></div></div><div class=\"note-editing-area\"><div class=\"note-handle\"><div class=\"note-control-selection\"><div class=\"note-control-selection-bg\"></div><div class=\"note-control-holder note-control-nw\"></div><div class=\"note-control-holder note-control-ne\"></div><div class=\"note-control-holder note-control-sw\"></div><div class=\"note-control-sizing note-control-se\"></div><div class=\"note-control-selection-info\"></div></div></div><textarea class=\"note-codable\"></textarea><div class=\"note-editable panel-body\" contenteditable=\"true\">\r\n<h3>100% Natural</h3>\r\n\r\n<p>All our products are 100% natural. Just the way nature intended. We should all be striving to eat less processed and packaged goods, and aim for 2 &amp; 5 (2 fruit and 5 veg serves per day )</p>\r\n</div></div><div class=\"note-statusbar\">  <div class=\"note-resizebar\">    <div class=\"note-icon-bar\"></div>    <div class=\"note-icon-bar\"></div>    <div class=\"note-icon-bar\"></div>  </div></div><div class=\"modal link-dialog\" aria-hidden=\"false\" tabindex=\"-1\"><div class=\"modal-dialog\">  <div class=\"modal-content\">    <div class=\"modal-header\">      <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">×</span></button>      <h4 class=\"modal-title\">Insert Link</h4>    </div>    <div class=\"modal-body\"><div class=\"form-group\"><label>Text to display</label><input class=\"note-link-text form-control\" type=\"text\"></div><div class=\"form-group\"><label>To what URL should this link go?</label><input class=\"note-link-url form-control\" type=\"text\" value=\"http://\"></div><div class=\"checkbox\"><label><input type=\"checkbox\" checked=\"\"> Open in new window</label></div></div>    <div class=\"modal-footer\"><button href=\"#\" class=\"btn btn-primary note-link-btn disabled\" disabled=\"\">Insert Link</button></div>  </div></div></div><div class=\"modal\" aria-hidden=\"false\" tabindex=\"-1\"><div class=\"modal-dialog\">  <div class=\"modal-content\">    <div class=\"modal-header\">      <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">×</span></button>      <h4 class=\"modal-title\">Insert Image</h4>    </div>    <div class=\"modal-body\"><div class=\"form-group note-group-select-from-files\"><label>Select from files</label><input class=\"note-image-input form-control\" type=\"file\" name=\"files\" accept=\"image/*\" multiple=\"multiple\"></div><div class=\"form-group note-group-image-url\" style=\"overflow:auto;\"><label>Image URL</label><input class=\"note-image-url form-control