rrent paragraph</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM0</kbd></label><span>Change current block\'s format as a paragraph(P tag)</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM1</kbd></label><span>Change current block\'s format as H1</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM2</kbd></label><span>Change current block\'s format as H2</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM3</kbd></label><span>Change current block\'s format as H3</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM4</kbd></label><span>Change current block\'s format as H4</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM5</kbd></label><span>Change current block\'s format as H5</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+NUM6</kbd></label><span>Change current block\'s format as H6</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+ENTER</kbd></label><span>Insert horizontal rule</span><div class=\"help-list-item\"></div><label style=\"width: 180px; margin-right: 10px;\"><kbd>CTRL+K</kbd></label><span>Show Link Dialog</span></div>    <div class=\"modal-footer\"><p class=\"text-center\"><a href=\"http://summernote.org/\" target=\"_blank\">Summernote 0.8.2</a> · <a href=\"https://github.com/summernote/summernote\" target=\"_blank\">Project</a> · <a href=\"https://github.com/summernote/summernote/issues\" target=\"_blank\">Issues</a></p></div>  </div></div></div></div>\r\n</div>\r\n\r\n<div class=\"wrape_all_sect\"><img src=\"&#10;http://www.binaryfrog.co/dev/assets/front/images/quality.png\">\r\n<div class=\"description\" style=\"display: none;\">\r\n<h3>Best Quality</h3>\r\n\r\n<p>We make no compromise on quality. We only buy Australian grown and the absolute best quality available within the Melbourne Markets. Our produce looks and tastes as good as the photos displayed.</p>\r\n</div><div class=\"note-editor note-frame panel panel-default\"><div class=\"note-dropzone\">  <div class=\"note-dropzone-message\"></div></div><div class=\"note-toolbar panel-heading\"><div class=\"note-btn-group btn-group note-style\"><div class=\"note-btn-group btn-group\"><button type=\"button\" class=\"note-btn btn btn-default btn-sm dropdown-toggle\" tabindex=\"-1\" data-toggle=\"dropdown\" title=\"\" data-original-title=\"Style\"><i class=\"note-icon-magic\"></i> <span class=\"note-icon-caret\"></span></button><div class=\"dropdown-menu dropdown-style\"><li><a href=\"#\" data-value=\"p\"><p>p</p></a></li><li><a href=\"#\" data-value=\"blockquote\"><blockquote>Quote</blockquote></a></li><li><a href=\"#\" data-value=\"pre\"><pre>Code</pre></a></li><li><a href=\"#\" data-value=\"h1\"><h1>Header 1</h1></a></li><li><a href=\"#\" data-value=\"h2\"><h2>Header 2</h2></a></li><li><a href=\"#\" data-value=\"h3\"><h3>Header 3</h3></a></li><li><a href=\"#\" data-value=\"h4\"><h4>Header 4</h4></a></li><li><a href=\"#\" data-value=\"h5\"><h5>Header 5</h5></a></li><li><a href=\"#\" data-value=\"h6\"><h6>Header 6</h6></a></li></div></div></div><div class=\"note-btn-group btn-group note-font\"><button type=\"button\" class=\"note-btn btn btn-default btn-sm note-btn-bold\" tabindex=\"-1\" title=\"\" data-original-title=\"Bold (CTRL+B)\"><i class=\"note-icon-bold\"></i></button><button type=\"button\" class=\"note-btn btn btn-default btn-sm note-btn-underline\" tabindex=\"-1\" title=\"\" data-original-title=\"Underline (CTRL+U)\"><i class=\"note-icon-underline\"></i></button><button type=\"button\" class=\"note-btn btn btn-default btn-sm\" tabindex=\"-1\" title=\"\" data-original-title=\"Remove Font Style (CTRL+\\)\"><i class=\"note-ic