INSERT INTO `tbl_system_settings` (`id`, `tbl_customer_type_from_id`, `tbl_system_settings_cms_page_name_id`, `description`, `meta_title`, `meta_keyword`, `meta_description`, `sorting`, `type`, `status`) VALUES
(2, 1, 4, '<div class=\"contact_page\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-4 col-sm-4\">\r\n<div class=\"conatct_pic\"><img alt=\"\" class=\"img-responsive\" src=\"http://www.binaryfrog.co/dev/assets/front/images/contact_new.jpg\"></div>\r\n</div>\r\n\r\n<div class=\"col-md-6 col-sm-7 contact-form pull-right\">\r\n<h1>Get in touch</h1>\r\n\r\n<p>Please feel free to contact us quickly and efficiently through our live chat, however if you don\'t have the time to chat now, feel free to fill in the details below and we will get back to you as soon as possible.</p>\r\n\r\n<form action=\"\" id=\"ContactForm\" method=\"post\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6 col-sm-6\"><!--<input class=\"form-control\" type=\"text\" placeholder=\"Name\">--><input name=\"name\" type=\"text\"></div>\r\n\r\n<div class=\"col-md-6 col-sm-6\"><textarea name=\"address\" rows=\"1\"></textarea></div></div></form></div></div></div></div>', 'Contact Us', 'Contact Us', 'Contact Us', 0, 'G', 1),
(3, 1, 3, '<div class=\"How_it_Works_Section\">\r\n <div class=\"container\">\r\n  <div class=\"row\">\r\n   <div class=\"col-sm-12 text-justify\">\r\n    <div class=\"top_font\">\r\n    <p>Fruitastic is a passion driven company which aims to deliver garden-fresh fruit and veggies to consumers all across Victoria. From day one our mantra has remained unchanged, which is to deliver premium quality fruits and vegetables with the fastest possible turnaround from farm to kitchen to all fellow Victorians. Fuelled by the overwhelming response of our patrons we are constantly striving for excellence. Fruitastic is as real as it gets, we are a customer centric company which always keeps its customers first. Our lightning fast home delivery service ensures that each customer receives fresh and mouth-watering fruits, like the ones displayed on our website. We are early risers and usually kick start our operations in early morning hours. Over the course of 15 years we have developed strong working ties with Premium Australian farms which help us deliver quality products at your door step. Fruitastic staunchly believes in sustainability and we are playing an active role in preserving our ecosystem as we only partner up with farms following sustainable farming methods. Our carefully crafted pictures help you navigate your way through our website, but still if you feel the need of assistance don\'t hesitate at all, simply click the Live Chat link and allow us to clear out any ambiguities.  </p>\r\n   </div>\r\n   </div>\r\n  </div>\r\n \r\n<!-------------------------- Start simple ordering section----------------------------->  \r\n  <div class=\"row simple_ordering\">\r\n   <div class=\"col-sm-12\"><h1>Simple Ordering</h1></div>\r\n   <div class=\"col-sm-3\">\r\n    <div class=\"row left_order\">\r\n     <div class=\"col-sm-7 text-center\">\r\n      <img src=\"common/images/if_270_2146255.svg\" class=\"img-responsive inln_block select_product\">\r\n      <p>Select Products</p>\r\n     </div>\r\n     <div class=\"col-sm-5 hidden-xs\">\r\n      <p class=\"hiw_brdr\"></p>\r\n      <p class=\"hiw_brdr_bottom\"></p>\r\n     </div>\r\n    </div>\r\n   </div>\r\n   <div class=\"col-sm-6\">\r\n    <div class=\"row\">\r\n     <div class=\"col-sm-4 text-center\">\r\n      <p class=\"brdr_right\"><span><img src=\"common/images/if_284_-Repeat-_interaction_communication_essential_1450976.svg\" class=\"img-responsive inln_block simple-ordering-icons\"></span></p>\r\n      <p>Reoccurring Order</p>\r\n     </div>\r\n     <div class=\"col-sm-4 text-center\">\r\n      <p class=\"brdr_right\"><span><img src=\"common/images/if_flat_seo2-07_334154.svg\" class=\"img-responsive inln_block simple-ordering-icons\"></span></p>\r\n      <p>Select Delivery Days</p>\r\n     </div>\r\n     <div class=\"col-sm-4 text-center\">\r\n      <p><span><img src=\"common/images/if_icon-176_942488.svg\" class=\"img-responsive inln_block simple-ordering-icons\"></span></p>\r\n      <p>Select Payment Mode</p>\r\n     </div>\r\n    </div>\r\n    <div class=\"row simple_order_margin\">\r\n     <div class=\"col-sm-4 text-center\">\r\n      <p class=\"brdr_right\"><span><img src=\"common/images/one-time-order.png\" class=\"img-responsive inln_block simple-ordering-icons\"></span></p>\r\n      <p>One Time Order</p>\r\n     </div>\r\n     <div class=\"col-sm-4 text-center\">\r\n      <p class=\"brdr_right\"><span><img src=\"common/images/if_Christmas_Date_1651916.svg\" class=\"img-responsive inln_block simple-ordering-icons\"></span></p>\r\n      <p>Set Delivery Date</p>\r\n     </div>\r\n     <div class=\"col-sm-4 text-center\">\r\n      <p><span><img src=\"common/images/if_Paypal_1094929.svg\" class=\"img-responsive inln_block simple-ordering-icons paypal_icon\"></span></p>\r\n      <p>Make Payment</p>\r\n     </div>\r\n    </div>\r\n   </div>\r\n   <div class=\"col-sm-3\">\r\n    <div class=\"row left_order\">\r\n	 <div class=\"col-sm-5 hidden-xs\">\r\n      <p class=\"hiw_brdr_right\