         <h4 class=\"text-center hidden-lg hidden-md hidden-sm\">24 Hours before Delivery</h4>\r\n       </div>\r\n       <div class=\"col-sm-3 dp_five_div\">\r\n         <div class=\"Confirming text-center\">\r\n         	<p><img src=\"http://localhost/school_codeIgniter/assets/image/Purchasing.svg\" class=\"img-responsive delivery-process-img\"></p>\r\n            <p>Purchasing Fresh Products</p>\r\n         </div>\r\n         <h4 class=\"text-center hidden-lg hidden-md hidden-sm\">12 Hours before Delivery</h4>\r\n       </div>\r\n       <div class=\"col-sm-3 dp_five_div\">\r\n         <div class=\"Confirming text-center\">\r\n         	<p><img src=\"http://localhost/school_codeIgniter/assets/image/packing-your.png\" class=\"img-responsive delivery-process-img\"></p>\r\n            <p>Packing Your Orders</p>\r\n         </div>\r\n         <h4 class=\"text-center hidden-lg hidden-md hidden-sm\">5 Hours before Delivery</h4>\r\n       </div>\r\n       <div class=\"col-sm-3 dp_five_div\">\r\n         <div class=\"Confirming text-center\">\r\n         	<p><img src=\"http://localhost/school_codeIgniter/assets/image/select-delivery.svg\" class=\"img-responsive delivery-process-img\"></p>\r\n            <p>Start Deliveries</p>\r\n         </div>\r\n         <h4 class=\"text-center hidden-lg hidden-md hidden-sm\">3 Hours before Delivery</h4>\r\n       </div>\r\n       <div class=\"col-sm-3 dp_five_div\">\r\n         <div class=\"Confirming text-center\">\r\n         	<p><img src=\"http://localhost/school_codeIgniter/assets/image/devilered-to-your-place.png\" class=\"img-responsive delivery-process-img\"></p>\r\n            <p>Delivered To Your Place</p>\r\n         </div>\r\n         <h4 class=\"text-center hidden-lg hidden-md hidden-sm\">Delivery</h4>\r\n       </div>\r\n     </div>\r\n     \r\n     <div class=\"row hidden-xs\">\r\n      <div class=\"col-sm-2 under_border\"></div>\r\n      <div class=\"col-sm-2 under_border2\"></div>\r\n      <div class=\"col-sm-2 under_border3\"></div>\r\n      <div class=\"col-sm-2 under_border4\"></div>\r\n      <div class=\"col-sm-2 under_border5\"></div>\r\n     </div>\r\n     \r\n     <div class=\"row text-center  hidden-xs\">\r\n      <div class=\"col-sm-3 dp_five_div\">\r\n       <p>24 Hours before Delivery</p>\r\n      </div>\r\n      <div class=\"col-sm-3 dp_five_div\">\r\n       <p>12 Hours before Delivery</p>\r\n      </div>\r\n      <div class=\"col-sm-3 dp_five_div\">\r\n       <p>5 Hours before Delivery</p>\r\n      </div>\r\n      <div class=\"col-sm-3 dp_five_div\">\r\n       <p>3 Hours before Delivery</p>\r\n      </div>\r\n      <div class=\"col-sm-3 dp_five_div\">\r\n       <p>Delivery</p>\r\n      </div>\r\n     </div>\r\n     \r\n     <div class=\"row hidden-xs\">\r\n      <div class=\"col-sm-10 col-sm-offset-1\">\r\n       <img src=\"http://localhost/school_codeIgniter/assets/image/reoccuring_orders.png\" class=\"img-responsive\">\r\n      </div>\r\n     </div>\r\n     \r\n     \r\n     <div class=\"row questions\">\r\n       <h2 class=\"heading\"><span class=\"h_span\">Questions</span></h2>\r\n       <p class=\"text-center\">If you have any questions, we would be more than happy to answers those for you. You could either check FAQ\'s Live Chat, Call us or leave us a message.</p>\r\n       \r\n       <div class=\"col-sm-3\">\r\n        <div class=\"question_div text-center\">\r\n         <p><img src=\"http://localhost/school_codeIgniter/assets/image/see.svg\" class=\"img-responsive question_div_img\"></p>\r\n         <p>See Frequently asked Questions</p>\r\n        </div> \r\n       </div>\r\n       <div class=\"col-sm-3\">\r\n        <div class=\"question_div text-center\">\r\n         <p><img src=\"http://localhost/school_codeIgniter/assets/image/see.svg\" class=\"img-responsive question_div_img\"></p>\r\n         <p>See Frequently asked Questions</p>\r\n        </div> \r\n       </div>\r\n       <div class=\"col-sm-3\">\r\n        <div class=\"question_div text-center\">\r\n         <p><img src=\"http://localhost/school_codeIgniter/assets/image/see.svg\" class=\"img-responsive question_div_img\"></p>\r\n         <p>See Frequently asked Questions</p>\r\n        </div> \r\n       </div>\r\n       <div class=\"col-sm-3\">\r\n        <div class=\"question_div text-center\">\r\n         <p><img src=\"http://localhost/school_codeIgniter/assets/image/see.svg\" class=\"img-responsive question_div_img\"></p>\r\n         <p>See Frequently asked Questions</p>\r\n        </div> \r\n       </div>\r\n      \r\n     </div>\r\n     \r\n    \r\n     \r\n      \r\n      \r\n       \r\n   </div>\r\n</section>', 'Meta Title', 'Meta Keyword', 'Meta Description*', 0, 'G', 1),
