(32, 4, 14, '<div class=\"container\"> \r\n \r\n <div class=\"blog_section\"> \r\n   \r\n   <div class=\"row\">\r\n    <div class=\"col-sm-8 col-md-8 col-sm-offset-2\">\r\n     <h2 class=\"inner_heading\">About <strong>Us</strong></h2>\r\n     <h4>Fresh office fruit delivery and other workplace essentials from Fruitbox</h4>\r\n     <h5 class=\"text-success\">Fruitbox was established in 2007 to help businesses to be more fruitful.</h5>\r\n	 <p>Having worked in large accounting firms for over a decade, I was looking for a change of direction. My move from bean counter to banana counter was somewhat unplanned. In 2005, I moved from the UK to Australia to study for a MBA and gain some wider knowledge and skills. Towards the end of the MBA course, I undertook an internship at a bank in Sydney, which provided fruit to their employees on a daily basis. I therefore saw first-hand how workplace fruit benefits both employee and employer. It was while I was sitting at my desk looking out over Sydney Harbour that the name of Fruitbox landed in my head. I packed my bags, returned to London to establish Fruitbox and the rest is history.</p>\r\n     <p>The business has grown rapidly. We now have over five thousand clients, one hundred employees, sixty plus vans and sell well in excess of two million bananas per year! We also offer cost-effective office milk deliveries to companies up and down the UK. Of course, milk is no good on its own so we also deliver tea and coffee plus other hot drinks to offices, with the option to add on sugar, biscuits and bread as well!</p>\r\n	 <p>With business blooming, Fruitbox now delivers flowers too – perfect for perking up meeting rooms and reception desks. View our selection of services including office fruit, snack boxes, tea and coffee, milk delivery and beautiful office flowers.</p>\r\n     <h5 class=\"text-success\">Name, Managing Director</h5>\r\n     \r\n     <h2 class=\"inner_heading\">Our delivery  <strong>network</strong></h2>\r\n     <h5 class=\"text-success\">Delivery is already included in all our prices, so no hidden extras.</h5>\r\n\r\n     \r\n     <div class=\"row\">\r\n       <div class=\"col-sm-9 col-md-9\">\r\n         <h5 class=\"text-success\">Flexible and friendly service</h5>\r\n         <h5>Our delivery services currently cover the majority of the UK mainland, as follows:</h5> \r\n            <ul>\r\n             <li><a href=\"#\">London &amp; Surrounding Areas</a></li>\r\n             <li><a href=\"#\">Manchester &amp; Surrounding Areas</a></li>\r\n             <li><a href=\"#\">Birmingham &amp; Surrounding Areas </a></li>\r\n             <li><a href=\"#\">Leeds &amp; Surrounding Areas </a></li>\r\n             <li><a href=\"#\">Edinburgh &amp; Surrounding Areas</a></li> \r\n             <li><a href=\"#\">Glasgow &amp; Surrounding Areas</a></li>\r\n             <li><a href=\"#\">Bristol &amp; Surrounding Areas</a> </li>\r\n             <li><a href=\"#\">Southampton &amp; Surrounding Areas</a> </li>\r\n             <li><a href=\"#\">Cardiff &amp; Surrounding Areas</a></li> \r\n           </ul>\r\n          </div>\r\n          <div class=\"col-sm-3 col-md-3 hidden-xs\">\r\n            <img src=\"http://localhost/corporate_codeIgniter/assets/images/map.png\" class=\"img-responsive\">\r\n          </div>\r\n    </div>\r\n    \r\n    <p>Our aim is to provide a nationwide office fruit, snack and flower delivery service. So if you cannot see your area listed, please contact us as we are expanding our delivery network all the time.</p>\r\n\r\n	<h5>Please note that we only deliver to mainland UK – so Northern Ireland, Scottish Islands, Isle of Wight or Isle of Man are not possible. If you have any questions please contact our team on 0656 567 3980.</h5>\r\n    \r\n    <h2 class=\"inner_heading\">Our <strong>SERVICE</strong></h2>\r\n   \r\n     <div class=\"row\">\r\n      <div class=\"col-sm-8 col-md-8\">\r\n       <h5 class=\"text-success\">Flexible fresh fruit at work</h5>\r\n    <p>If you are looking to order fruit for the office, we provide a friendly, flexible and reliable service. We aim to tailor our service to your company’s needs, tastes and budget. We can cater for small and large businesses alike on a regular (e.g. daily, twice weekly, weekly) or ad hoc basis, and we deliver across the UK mainland. Should you have any specific preferences or dislikes for the range of fruit in the workplace, we can alter the selection accordingly.</p>  \r\n      </div>\r\n      <div class=\"col-sm-4 col-md-4 hidden-xs\">\r\n       <p><img src=\"http://localhost/corporate_codeIgniter/assets/images/thickbox_default.jpg\" class=\"img-responsive\"></p>\r\n      </div>\r\n     </div>\r\n     \r\n     \r\n     <h5 class=\"text-success\">Top quality fruit guaranteed</h5>\r\n\r\n	 <p>Our fruit is bought each morning from reliable and trusted suppliers at highly-regarded traditional wholesale markets across the UK mainland. We only provide the highest grade fresh fruit to offices up and down the country. Fruitbox employees hand select the fruit and pack it carefully into our boxes ready for delivery to your workplace. Each item of fruit is checked for imperfections and we offer a guarantee to replace any fruit should you find any damaged or over ripe.</p>\r\n\r\n 	 <h5 class=\"text-success\">Other office essentials</h5>\r\n\r\n	 <p>Simplify stocking up the office kitchen with regular deliveries of milk, tea, coffee and snacks. Like our fresh fruit boxes, our milk, drink and snack delivery service is reliable and tailored to your needs. We can also deliver a bouquet of beautiful flowers for your meeting room or reception desk. At Fruitbox, our aim is to make your life easier by delivering office essentials straight to your workplace. Find out more about our milk, Nutribox, tea, coffee and flower delivery services, or call us on 0655 366 3450.</p>\r\n     \r\n     <h5 class=\"text-success\">No contract and different payment options</h5>\r\n\r\n	<p>We don’t believe in tying you into a contract. We will simply invoice you every four weeks with a thirty day payment term. If at any time you wish to stop using our service, all we ask is that you provide us with forty-eight hours’ notice. Invoices can be settled by BACS, cheque or credit/debit card.</p>\r\n     \r\n     \r\n     \r\n     \r\n    </div>\r\n   \r\n   </div>\r\n   \r\n   \r\n    \r\n </div>\r\n\r\n</div>', 'wwer', 'werwe', 'rwerwe', 4, 'G', 1);
