CREATE DEFINER=`root`@`localhost` PROCEDURE `order_add_in_po_proc` (IN `tbl_purchase_order_id` INT)  BEGIN

BLOCK1: BEGIN 
DECLARE orderid,p,warehouse_id_v int;
DECLARE orderdate date;
DECLARE tbl_purchase_order_cursor CURSOR FOR
SELECT `order_id`
,(SELECT DISTINCT `purchase_order_date` FROM `tbl_purchase_order` WHERE `id`=tbl_purchase_order_id) as rdate
,(SELECT DISTINCT `warehouse_id` FROM `tbl_purchase_order` WHERE `id`=tbl_purchase_order_id) as whr_id
FROM `tbl_recurring_order` WHERE `deleted`='0' AND `status`='1' AND 
`run_detail_id` in  (SELECT DISTINCT `id` FROM `tbl_run_detail` WHERE `run_date`in (SELECT DISTINCT `purchase_order_date` FROM `tbl_purchase_order` WHERE `id`=tbl_purchase_order_id AND `receiving_by`='0')) order by id DESC;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET p = 1;
OPEN tbl_purchase_order_cursor;
get_order: LOOP
FETCH FROM tbl_purchase_order_cursor INTO orderid,orderdate,warehouse_id_v;
IF p = 1 THEN 
LEAVE get_order;
END IF;


	BLOCK2: BEGIN 
		
		DECLARE product_id_c,qty_c,cat_id_c,crnt_stock,purchase_order_detail_id,b int;
		DECLARE purchase_order_id int;
		DECLARE cur CURSOR FOR
		
    
    SELECT  tord_sm.product_id, tord_sm.qty ,
    (SELECT cat_id FROM tbl_product WHERE id=tord_sm.product_id)as ct ,
    (SELECT `current_stock` FROM `tbl_product_stock` WHERE `warehouse_id`=warehouse_id_v AND `product_id`=tord_sm.product_id)AS cst
    
FROM tbl_order_summary as tord_sm
join tbl_order as tord on tord.id =tord_sm.order_id
WHERE tord_sm.order_id =orderid AND  tord.approved_order =1 ORDER BY tord_sm.id ASC;
    
    
    
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET b = 1;
		OPEN cur;
		get_product: LOOP
		FETCH FROM cur INTO product_id_c,qty_c,cat_id_c,crnt_stock;
		IF b = 1 THEN 
