                        UPDATE `tbl_purchase_order_detail` as tpod SET  tpod.`requerd_stock`=(tpod.`requerd_stock`+(qty_box*qty_c)), tpod.`current_stock`=crnt_stock_box WHERE tpod.`purchase_order_id`=tbl_purchase_order_id AND tpod.`product_id` = product_id_box;
                        	
                       END;
