CREATE DEFINER=`root`@`localhost` PROCEDURE `order_add_in_po_proc_update` (IN `tbl_purchase_order_id` INT)  BEGIN
	if EXISTS(SELECT tpo.id FROM `tbl_purchase_order` AS tpo WHERE tpo.`id`=tbl_purchase_order_id AND 

tpo.receiving_by='0' )
  THEN
    BEGIN
	
        DELETE FROM `tbl_purchase_order_detail`  WHERE  `purchase_order_id`=tbl_purchase_order_id ;
         
         BLOCK2: BEGIN 
         UPDATE `tbl_purchase_order_detail` as tpod SET 

tpod.`current_stock`='',tpod.`requerd_stock`='',tpod.`order_stock`='' WHERE (tpod.`receiving_stock`=0 OR 

tpod.`receiving_stock`='') AND tpod.`purchase_order_id`=tbl_purchase_order_id and 
        
        (tpod.`product_id` 
        in (SELECT  `tod`.`product_id` as `product_id`
        FROM  `tbl_purchase_order` as `tbl_po` 
        JOIN `tbl_run_detail` as `trd` ON `trd`.`warehouse_id`=`tbl_po`.`warehouse_id` AND `trd`.`run_date` = 

`tbl_po`.purchase_order_date
        JOIN `tbl_recurring_order` as `tro` ON `tro`.`run_detail_id`=`trd`.`id`
        JOIN `tbl_order_summary` as `tod` ON `tod`.`order_id`=`tro`.`order_id`
        JOIN `tbl_product` as `tp` ON `tp`.`id`=`tod`.`product_id`
        JOIN `tbl_order` as `ttd` ON `ttd`.`id`=`tro`.`order_id`
        WHERE `ttd`.`status` = '1'
        AND `ttd`.`deleted` = '0'
        AND `ttd`.`approved_order` = '1'
        AND `tbl_po`.`id`=tbl_purchase_order_id 
        AND `tbl_po`.`receiving_by`='0'
        GROUP BY `tod`.`product_id`) 
        or 
         tpod.`product_id` in                                                                                            
        (SELECT  `tbl_pb`.`product_id` as `product_id`
        FROM  `tbl_purchase_order` as `tbl_po` 
        JOIN `tbl_run_detail` as `trd` ON `trd`.`warehouse_id`=`tbl_po`.`warehouse_id` AND `trd`.`run_date` = 

`tbl_po`.purchase_order_date
        JOIN `tbl_recurring_order` as `tro` ON `tro`.`run_detail_id`=`trd`.`id`
        JOIN `tbl_order_summary` as `tod` ON `tod`.`order_id`=`tro`.`order_id`
        JOIN `tbl_product` as `tp` ON `tp`.`id`=`tod`.`product_id`
        JOIN `tbl_order` as `ttd` ON `ttd`.`id`=`tro`.`order_id`
        JOIN `tbl_product_box` as `tbl_pb` on `tbl_pb`.box_id= `tod`.product_id 
        WHERE `ttd`.`status` = '1'
        AND `ttd`.`deleted` = '0'
        AND `ttd`.`approved_order` = '1'
        AND `tp`.`cat_id`='7'
        AND `tbl_po`.`id`=tbl_purchase_order_id 
        AND `tbl_po`.`receiving_by`='0'
         GROUP BY `tod`.`product_id`)
         );
         END BLOCK2;BLOCK1: BEGIN 
        call order_add_in_po_proc(tbl_purchase_order_id);
        END BLOCK1;
	END;
    END IF;	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `po_recieve` (IN `purchase_order_id_p` INT, IN `currunt_date_time` DATETIME)  BEGIN  	
  	DECLARE order_id_p,b int;
  	DECLARE cur CURSOR FOR
  	SELECT tro.order_id as order_id		
				FROM `tbl_purchase_order` 			as `tpo` 
				JOIN `tbl_run_detail` 				as `trd` ON `trd`.`warehouse_id`=`tpo`.`warehouse_id` AND `trd`.`run_date`=`tpo`.`purchase_order_date`
				JOIN `tbl_recurring_order` 			as `tro` ON `tro`.`run_detail_id`=`trd`.`id`
				JOIN `tbl_order` 					as `tto` ON `tto`.`id`=`tro`.`order_id`
				WHERE 
				`tpo`.receiving_by='0'		
				AND `tpo`.`deleted` = '0'
				AND `tpo`.`status` = '1'
				AND `tpo`.`id` = purchase_order_id_p		
				GROUP BY `tro`.`id`
				ORDER BY `tro`.`id` DESC;
  	DECLARE CONTINUE HANDLER FOR NOT FOUND SET b = 1;
  	OPEN cur;
  	get_po_order_id: LOOP
  	FETCH FROM cur INTO order_id_p;
  	IF b = 1 THEN 
  	LEAVE get_po_order_id;
  	END IF;
   		
        BLOCK2: BEGIN
        	DECLARE receiving_by_p,product_id_p,a int;
        	DECLARE cur_box CURSOR FOR 
        	SELECT `tpod`.`receiving_by`,`tpod`.`product_id`
						FROM `tbl_purchase_order_detail` 	as `tpod`        
						JOIN `tbl_order_summary` 			as `tos` ON `tos`.product_id=`tpod`.product_id  AND `tos`.`order_id`=order_id_p 
						JOIN `tbl_product` 					as `tp`  ON `tp`.`id`=`tos`.`product_id`        
						WHERE 
						`tpod`.`deleted` = '0'
                        AND `tpod`.`status` = '1'                       						
						AND `tpod`.`purchase_order_id` = purchase_order_id_p
						AND `tp`.`cat_id` != '7'
						GROUP BY `tos`.`product_id`
						ORDER BY `tpod`.`id` DESC;
			DECLARE CONTINUE HANDLER FOR NOT FOUND SET a = 1;
  			OPEN cur_box;
  			get_product_box: LOOP
  			FETCH FROM cur_box INTO receiving_by_p,product_id_p;
  			IF a = 1 THEN 
  			LEAVE get_product_box;
  			END IF;
            	if(receiving_by_p=1)THEN 
                    BEGIN
                    	
                        UPDATE `tbl_order_summary` SET 
								`qty`=(`tbl_order_summary`.amount/`tbl_order_summary`.product_price),
								`deleted`='0'
								WHERE `order_id`=order_id_p AND `product_id`=product_id_p;
                                
                		UPDATE `tbl_order_summary_tracking` SET 
								`po`='1',
								`po_date`=currunt_date_time
								WHERE `order_id`=order_id_p AND `product_id`=product_id_p;	
                    end;
                ELSE
                    BEGIN
                    	
                    	UPDATE `tbl_order_summary` SET 
								`qty`='0',
								`not_managed_by_admin`='1',
								`deleted`='1'
								WHERE `order_id`=order_id_p AND `product_id`=product_id_p;
                                
						UPDATE `tbl_order_summary_tracking` SET 
								`cancel_by_admin`='1',
								`cancel_by_admin_date`=currunt_date_time
								WHERE `order_id`=order_id_p AND `product_id`=product_id_p;	
                    END;
                END IF;
    		END LOOP get_product_box;
  			CLOSE cur_box;
       END BLOCK2; 
       UPDATE `tbl_order` SET 
			`order_status`='6'
			WHERE `id`=order_id_p;	
  END LOOP get_po_order_id;
  CLOSE cur; 
  UPDATE `tbl_purchase_order` SET 
			`receiving_by`='1',
			`receiving_date`=currunt_date_time
			WHERE `id`=purchase_order_id_p;
END$$

